scrollTo = (element) => {
  window.scroll({
    behavior: 'smooth',
    left: 0,
    top: element.offsetTop
  });

}
document.getElementById("about").addEventListener('click', () => {
  scrollTo(document.getElementById("aboutNew"));
});

document.getElementById("toMiddle").addEventListener('click', () => {
  scrollTo(document.getElementById("5"));
});

document.getElementById("toFirst").addEventListener('click', () => {
  scrollTo(document.getElementById("1"));
});




